import logo from './logo2.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className=""><img src={logo} className="App-logo" alt="logo" /></div>
        <nav>
          <ul>
            <li></li>
          </ul>
        </nav>
      </header>
    </div>
  );
}

export default App;
